import React from 'react'
import { Link } from 'react-router-dom'
import './NavBar.css'

function NavBar() {
    return (
        <div className="navbar">
            <ul>
                <li><Link to="/">Login</Link></li>
                <li><Link to="/dashboard">Dashboard</Link></li>
                <li><Link to="/signup">SignUp</Link></li>
            </ul>
        </div>
    );
}

export default NavBar;
